CREATE TABLE IF NOT EXISTS "users_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "avatar" varchar(100) NOT NULL, "gender" varchar(10) NOT NULL, "bio" text NOT NULL, "birthdate" date NULL, "language" varchar(2) NOT NULL, "currency" varchar(3) NOT NULL, "superhost" bool NOT NULL, "email_confirmed" bool NOT NULL, "email_secret" varchar(20) NOT NULL, "login_method" varchar(50) NOT NULL, "first_name" varchar(30) NOT NULL);
